import './topBar.css';
import {Container,
    Navbar,
    Row,
    Form,
    FormControl,
    Button,
} from 'react-bootstrap';
import { useState } from 'react';

export default function TopBar() {
  const [SearchTerm, setSearchTerm]=useState("")
  return (
    <div className='topbar'> 

    <Navbar>
        <Container>

            <Navbar.Toggle />
            <Navbar.Collapse className="justify-content-center">
            <Navbar.Brand className="navbarBrandName" href="/">EmojiBook </Navbar.Brand>
            <Form className="d-flex">

            <FormControl
                type="search"
                onChange={(event)=>{setSearchTerm(event.target.value)}}
                placeholder="Search"
                className="mr-2 navbarSearch"
                aria-label="Search"
            />

            </Form>
            {SearchTerm !==nul ?(' ' ) :(
                          <div className="homeSearchResult"> 
                          <ul>
                          {emojibook.filter((val)=>{
                              if(searchTerm==""){
                              } else if (val.name.toLowerCase().includes(searchTerm.toLowerCase())||val.emoji.toLowerCase().includes(searchTerm.toLowerCase())) {
                                return val
                              }
                            }).map((val,key)=>{
                              return (
                                 <li key={key} className="homeSearchResultItem"> 
                                     <Link className="link" to={`/detail/${val.id}`}>
                                        {val.emoji} {' '} { val.name}
                                      </Link>
                                 </li>

                                )
                              })}
                              </ul>
                              </div>
            ) }
            </Navbar.Collapse>
        </Container>
    </Navbar>
    </div>
  )
}
